        this.flags = {
            C: false,
            Z: false,
            I: false,
            D: false,
            B: false,
            U: false,
            V: false,
            N: false,
        };
        this.pc = 0;
        this.sp = 0;
        this.a = 0;
        this.x = 0;
        this.y = 0;
        // adressing modes
        this.IMP = () => {
            // implied
            this.fetched = this.a;
            return 0;
        };
        this.IMM = () => {
            // immediate
            this.addr_abs = this.pc;
            this.pc++;
            return 0;
        };
        this.ZP0 = () => {
            // zero page
            this.addr_abs = this.read(this.pc) & 0x00ff;
            this.pc++;
            return 0;
        };
        this.ZPX = () => {
            // zero page with offset from X register
            this.addr_abs = this.read(this.pc + this.x) & 0x00ff;
            this.pc++;
            return 0;
        };
        this.ZPY = () => {
            // zero page with offset from Y register
            this.addr_abs = this.read(this.pc + this.y) & 0x00ff;
            this.pc++;
            return 0;
        };
