            // absolute
            const low = this.read(this.pc);
            this.pc++;
            const high = this.read(this.pc);
            this.pc++;
            this.addr_abs = (high << 8) | low;
            return 0;
        };
        this.ABX = () => {
            // absolute with offset from X register
            const low = this.read(this.pc);
            this.pc++;
            const high = this.read(this.pc);
            this.pc++;
            this.addr_abs = ((high << 8) | low) + this.x;
            if ((this.addr_abs & 0xff00) != high << 8) {
                return 1;
            }
            return 0;
        };
