                return this.flags.Z;
        }
    }
    SetFlag(flag, state) {
        switch (flag) {
            case Flags.B: {
                this.flags.B = state;
                break;
            }
            case Flags.C: {
                this.flags.C = state;
                break;
            }
            case Flags.D: {
